import { useNavigate } from "react-router-dom";

export const Contact = () => {
  const navigate = useNavigate();

  const handleNavigation = () => {
    navigate("/");
  }

  return (
    <div>
      <h1>Contact Us</h1>
      <button onClick={handleNavigation}>Go to Home</button>
    </div>
  )
}
